import React, { useEffect, useState } from "react";
import axios from "axios";
import FormBuilder from "./FormBuilder";
import FormSubmit from "./FormSubmit";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";

export default function FormSubmissions(props) {
  const [formFields, setFormFields] = useState([]);
  const [formInputs, setFormInputs] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/forms/getFormFields", {
        params: {
          id: props.match.params.FormId,
        },
      })
      .then((res) => {
        // console.log(res);
        console.log(res);
        setFormFields(res.data);
      });

    axios
      .get("http://localhost:5000/forms/getFormInputs", {
        params: {
          id: props.match.params.FormId,
        },
      })
      .then((res) => {
        // console.log(res);
        console.log(res);

        setFormInputs(res.data);
      });

    //console.log(forms);

    //console.log(forms);
  }, []);

  // useEffect(() => {

  // }, []);
  // useEffect(() => {
  //   console.log(forms);

  //   //console.log(forms);
  // }, [forms]);

  return (
    <div className="FormsList">
      <TableContainer component={Paper}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow key={formFields._id}>
              {formFields.map((field) => {
                return <TableCell>{field.inputName}</TableCell>;
              })}
            </TableRow>
          </TableHead>

          <TableBody>
            {formInputs.map((rows) => (
              <TableRow key={rows._id}>
                {rows.inputs.map((input) => (
                  <TableCell>{input}</TableCell>
                ))}
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}
